            this.labelControl104.Text = "    自体输血是一种有效的治疗手段，自体输血可以避免经血传播疾病，对一时无法获得同型血的患者也是唯一的血源；可以避免同种免疫反应的产生；可以避免发生输注同种异体" +
    "血的差错事故等优点。但是在采集时也存在一定的风险：如晕针、晕血、晕厥、血肿、低血压等。\r\n    我院将严格按照国家的有关规定进行血液采集，采血时所使用的器具及" +
    "耗材都符合国家的有关规定以确保患者的安全。";
